        component: login
    },
    {
        path: '/login2',
        component: login2
    },
    {
        path: '/extract',
        component: extract
    },
    {
        path: '/test',
        component: test
    },
    {
        path: '/test2',
        component: test2
    },
    {
        path: '/query2',
        component: query2
    },
    {
        path: '/k',
        component: k
    },

    {
        path: '/product',
        component: product_query
    },
    {
        path: '/product2',
        component: product2
    },
    {
        path: '/person',
        component: f10_person
    },
    {
        path: '/stock',
        component: f10_stock
    },
    {
        path: '/company',
        component: f10_company
    },
    {
        path: '/demo',
        component: demo
    },
    {
        path: '/modify',
        component: modify
    },
    {
        path: '/shiti',
        redirect: 'https://www.baidu.com'
    },
    {
        path: '/query',
        component: query
    },

]

const router = new VueRouter({
    routes
})
export default router
